wikitext.*:
本模板修改自中文维基百科的[[zhwiki:模板:Status2]]。
== 使用方法 ==
{|
|-
| <pre>{{状态}}</pre>
| {{状态}}
|-
| <pre>{{状态|任意说明}}</pre>
| {{状态|任意说明}}
|-
| <pre>{{状态|完成}}</pre>
| {{状态|完成}}
|-
| <pre>{{状态|完成|任意说明}}</pre>
| {{状态|完成|任意说明}}
|-
| <pre>{{状态|完成|color=blue}}</pre>
| {{状态|完成|color=blue}}
|-
| <pre>{{状态|拒绝}}</pre>
| {{状态|拒绝}}
|-
| <pre>{{状态|拒绝|任意说明}}</pre>
| {{状态|拒绝|任意说明}}
|-
| <pre>{{状态|搁置}}</pre>
| {{状态|搁置}}
|-
| <pre>{{状态|搁置|任意说明}}</pre>
| {{状态|搁置|任意说明}}
|-
| <pre>{{状态|prefix=进展：}}</pre>
| {{状态|prefix=进展：}}
|-
| <pre>{{状态|prefix=}}</pre>
| {{状态|prefix=}}
|-
| <pre>{{状态|prefix=|}}</pre>
| {{状态|prefix=|}}
|-
| <pre>{{状态|color=#66CCFF}}</pre>
| {{状态|color=#66CCFF}}
|-
| <pre>{{状态|prefix=代表色：|color=pink|粉色}}</pre>
| {{状态|prefix=代表色：|color=pink|粉色}}
|}

注：拒绝、搁置均支援繁体中文。

若指定了category参数，则会将所在页面加入对应分类，状态参数设为同意类或拒绝类后分类自动移除。
